import React from "react";
import { Link } from "react-router-dom";

const Home: React.FC = () => (
  <div style={{ textAlign: "center", marginTop: 40 }}>
    <h1>Catálogo de Cortinas a Medida</h1>
    <nav style={{ margin: 20 }}>
      <Link to="/catalog" style={{ margin: 10 }}>Catálogo</Link>
      <Link to="/calculator" style={{ margin: 10 }}>Calculadora</Link>
      <Link to="/admin" style={{ margin: 10 }}>Admin</Link>
    </nav>
    <p>Bienvenido a la plataforma interactiva de cortinas a medida.</p>
  </div>
);

export default Home;
